Guns are the No. 1 cause of death for children in America. Our kids deserve better.

There are common sense solutions to #StopGunViolence – an assault weapons ban, red flag laws, and banning high-capacity magazines. And they're popular too.

@HouseGOP, when will you act?

House Democrats are committed to putting #PeopleOverPolitics. 

@POTUS Biden’s Budget will work to lower costs, create better paying jobs, and make our communities safer. 

Where’s the extreme MAGA Republican budget plan? Oh, right—they don’t have one.
